//旋转木马元素添加
function asgion(){
    for (var i = 0; i < arrplay.length; i++) {
        animatemu(arrplay[i],config[i])
    }
    flag = true
}
asgion();
function move() {
    if (flag) {//当flag为true即节流阀是打开的状态时，才能执行动画
        flag = false;//当动画执行时，将flag设置为false，关闭节流阀
        config.push(config.shift());//把最前面的元素放到最后面
        //config.unshift(config.pop());//把最后面的元素放到最前面
        //让所有的li按照新生成的config配置单渐渐地各就各位
        asgion()
    }
}
timeer = setInterval(move,5000);
    for (let j = 0; j < arrplay.length; j++) {
        arrplay[j].onclick = function () {
            clearInterval(timeer);
            config.push(config.shift());
            asgion()
        }
    }
function scroll() {
    return {
        top: window.pageYOffset || document.documentElement.scrollTop || document.body.scrollTop || 0,
        left: window.pageXOffset || document.documentElement.scrollLeft || document.body.scrollLeft || 0
    };
}//获取当前位置
var now = 0;//当前
var item = 0;//目标
var isruning = false;//节流
function  pagedown(){
    if(!isruning){
        isruning = true;
        if (page<arrPage.length-1){
            page++;
            clearInterval(timer);
            now = Math.ceil(scroll().top);
            if (page==1){
                item = arrPage[page].offsetTop-50;
            }else {
                item = arrPage[page].offsetTop;
            }
            timer = setInterval(function(){
                var  step = (now-item)/10;
                step = step>0?Math.ceil(step):Math.floor(step);
                now = now-step;
                window.scrollTo(0,now);
                if (now === item){
                    clearInterval(timer);
                }
            },10);
        }
        isruning = false
    }
}//向下
function pageup(){
    if(!isruning){
        isruning = true;
        if (page>0){
            now = Math.ceil(scroll().top);
            if (page==2){
                item = arrPage[page-1].offsetTop-50;
            }else {
                item = arrPage[page-1].offsetTop;
            }
            clearInterval(timer);
            timer = setInterval(function(){
                var   step = (now-item)/10;
                step = step>0?Math.ceil(step):Math.floor(step);
                now = now-step;
                window.scrollTo(0,now);
                if (now === item){
                    clearInterval(timer);
                }
            },10);
            page--
        }
        isruning = false;
    }
}//向上
function addEvent(ele, type, listener) {
    if (ele.addEventListener) {
        ele.addEventListener(type, listener);
    } else {
        ele.attachEvent("on" + type, listener);
    }
}
addEvent(window, "mousewheel", mouseWheel);
// 滚轴事件函数
function mouseWheel(ev) {
    var oEvent = window.event || ev;
    if(Math.ceil(scroll().top)>=arrPage[2].offsetTop){
        return;
    }
    if (oEvent.detail) {
        if (oEvent.detail > 0) {
            pagedown()
        } else {
            pageup()
        }
    } else if (oEvent.wheelDelta) {
        if (oEvent.wheelDelta > 0) {
            pageup();
        } else {
            pagedown()
        }
    }
}
