function mapstitadd(obj,json){
    for(var k in json){
        if(k==="maps-type" ){
            obj.setAttribute('maps-type',json[k])
        }else if(k === "maps-type-name"){
            obj.getElementsByClassName('maps-type-name')[0].innerText = json[k];
        }else if(k ==="svg"){
            obj.getElementsByClassName('map-type-icon')[0].innerHTML = json[k];
        }else{
            obj.getElementsByClassName('map-type-description')[0].innerHTML = json[k];
        }

    }
}
